import React, { Component} from 'react'


export class NotFound extends Component {
    render() {
        return (
            <header className="App-header">
        <p>
          KS2TM
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
        );
    }
}
